import React from 'react';
import Menu from '../Menu';
import { ContainerSection, Content } from './styles';

const Container: React.FC = ({ children }) => {
  return (
    <ContainerSection>
      <Menu />
      <Content>{children}</Content>
    </ContainerSection>
  );
};

export default Container;
